description:
18 may 2012

Johnny is a miserable IT worker at a firm with three smokin' ladies. And while Kelly, Kianna and Sativa may be attractive, Johnny
has come to understand over the years that their bark is worse than their bite; each woman a temptress to his imagination and then a soul crushing
bitch in the cold light of day.

